// src/components/CarList.js
import React from 'react';
import CarCard from './CarCard';
import Styles from './CarSeller.module.css';

const CarList = ({ cars }) => {
  return (
    <div className={`row ${Styles.car_list}`}>
      {cars.map((car, index) => (
        <div key={index} className={`col-md-4 col-lg-4 ${Styles.car_col}`}>
          <CarCard car={car} />
        </div>
      ))}
    </div>
  );
};

export default CarList;
